import React from 'react'
import Todo from './Todo'

const TodoList = ({ listData,setListData }) => {
    return (
        <div>
            <ul>
                {listData.map((el) => <Todo key={el.id} value={el.value}
                    listData={listData} todo={el} setListData={setListData} />)}
            </ul>
        </div>
    )
}

export default TodoList
